import React from 'react';
import styled from 'styled-components';
import cart from '../images/cart.jpg';

const CartPage = () => {
	return (
		<CartPageWrapper>
			<div className='banner'>
				<img src={cart} alt='' />
			</div>
		</CartPageWrapper>
	);
};

export default CartPage;
const CartPageWrapper = styled.section`
	position: relative;
	top: 71px;
	width: 100%;
	.banner {
        width 100%;
	}
`;
